// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.5.0 < 0.9.0 ;

contract state{

uint public age;
// this is a state variable
// age = 20; this is wrong , u cant do that in solidity
// uint public age = 20; this is perfect
// OR

function setage() public 
{
age = 10;
// when u click on the button setage , this function will be automatically called
}

constructor() {
    age = 20;
}

// constructor is called directly when program is deployed
// can also add parameters to constructors

function store() pure public returns(uint){

    // pure means this function only deals with local variables
    uint age1 = 10;
    // this is a local variable
    // they are stored in stack

    // string name = "swaraj";
    // if you deploy this you will get an error cause string data types variables can't be stored in stack 
    // , they are directly stored under the contract 
    // to store them locally that is in the stack u need to use the keyword memory , for eg;-
    string memory name = "swaraj";
    // to store them under contract we can use normally;
    // string name ="swaraj"
    return age1;
}

function getter() public view returns(uint){
return age;
}

// view is used when the contract or state variable is read but not written/modified
// pure is used when the contract or state variable is not read as well as not written/modified


function getter2() public pure returns(uint){
    uint roll=10;
return roll;
// here state variable is neither read nor written , so we can use pure
}

uint [4] public arr = [10,20,30,40];

function setter(uint index , uint value) public {
arr[index] = value;

}

function length () public view returns (uint) {
    return arr.length;
}

uint[] public array ;

function pushelement (uint item) public {
array.push(item);
}

function len() public view returns (uint){
    return arr.length;
}

function popelement() public {
    array.pop();
}

 
uint[3] public array2;
uint public count;
function loop() public 
{
while (count<array2.length){
    array2[count] = count;
}
}

// for and do while loops can also be made
// loops are to be made inside the function

// if else should also be made inside the function

bool public value;

// by default , bool variable stores false
// public variables bydefault makes getters


}

